var keypad = [
  [0,0,1,0,0],
  [0,2,3,4,0],
  [5,6,7,8,9],
  [0,'A','B','C',0],
  [0,0,'D',0,0]
]

var instructions = [
  "",
  "",
  "",
  "",
  ""
];

var parseInstruction = function(instruction, startingPoint) {
  var moves = instruction.split('');
  return moves.reduce(function(acc, cur){
    var row = Math.min(4, Math.max(0, acc.row + ((cur === 'U') ? -1 : ((cur === 'D') ? 1 : 0))));
    var col = Math.min(4, Math.max(0, acc.col + ((cur === 'L') ? -1 : ((cur === 'R') ? 1 : 0))));
    if (keypad[row][col]) {
      return { row: row, col: col };
    } else {
      return acc;
    }
  }, startingPoint);
}

var start = { row: 2, col: 0 };

var code = instructions.reduce(function(acc, instruction){
  var temp = parseInstruction(instruction, start);
  start = temp;
  return acc + keypad[temp.row][temp.col];
}, '');

console.log(code); // 3CC43
